PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> PREFIX : <http://rdf.freebase.com/ns/> 
SELECT (?x0 AS ?value) WHERE {
SELECT DISTINCT ?x0  WHERE { 
?x0 :type.object.type :measurement_unit.magnetic_flux_density_unit . 
{
SELECT (MAX(?y1) AS ?x1)  WHERE { 
?y0 :type.object.type :measurement_unit.magnetic_flux_density_unit . 
?y0 :measurement_unit.magnetic_flux_density_unit.density_in_teslas ?y1 . 
FILTER ( ?y0 != ?y1  )
}
}
?x0 :measurement_unit.magnetic_flux_density_unit.density_in_teslas ?x1 . 
FILTER ( ?x0 != ?x1  )
}
}

